const App = () => {
  const categories = [
    {
      title: "Hats",
    },
  ];

  return (
    <div className='categories-container'>
      <div className='category-container'>
        {/*  image of cat  */}
        <div className='category-body-container'>
          <h2>Hats</h2>
          <p>Shop now</p>
        </div>
      </div>
      <div className='category-container'>
        {/*  image of cat  */}
        <div className='category-body-container'>
          <h2>Jackets</h2>
          <p>Shop now</p>
        </div>
      </div>
      <div className='category-container'>
        {/*  image of cat  */}
        <div className='category-body-container'>
          <h2>Sneakers</h2>
          <p>Shop now</p>
        </div>
      </div>
      <div className='category-container'>
        {/*  image of cat  */}
        <div className='category-body-container'>
          <h2>Womens</h2>
          <p>Shop now</p>
        </div>
      </div>
      <div className='category-container'>
        {/*  image of cat  */}
        <div className='category-body-container'>
          <h2>Mens</h2>
          <p>Shop now</p>
        </div>
      </div>
    </div>
  );
};

export default App;
